import React from 'react';
import ReactDOM from 'react-dom';
var t = new Date();
var time = t.getHours();
const sen = "Good Night";
if(time<=12){ sen = "Good Morning"; }
else if(time<=4){ sen ="Good After-Noon"; }
else if(time<=7){ sen = "Good Evening"; }
ReactDOM.render(
  <>
     <h1 className= "head">HII EVERYONE { sen }</h1>
     <p> current time is { time }</p>
  </>,
  document.getElementById('root')
);
